INSERT INTO `cms` (`cms_id`, `page_id`, `description_en`, `description_el`, `image`, `is_active`, `create_date`) VALUES
(5, 'about', '<h1 id="HEADING" property="name" class="heading_name  " style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 2.3335em; font-weight: bold; font-stretch: normal; line-height: 30.8022px; font-family: Arial, Tahoma, "Bitstream Vera Sans", sans-serif; display: inline-block; width: inherit; word-wrap: break-word; color: rgb(44, 44, 44);">Nice n Easy</h1><p><br>The relentless pursuit of the alternative, the qualitative, the substantial way of living, led us to a journey filled with flavors, aromas, sounds and images that we felt the need to share with you.Thus, we created a place full of experience we gathered in our travels and we welcome you in it with a mood as friendly and relaxing as our name.Our menu is focused on quality and value. With that in mind, we use as many bio products as we can for the preparation and creation of the beverage and meals that serve you. We believe in fresh ingredients with the least possible intervention.<br></p>', '<h3 align="center"><b>CREATED BY THE BEST SERVED WITH </b></h3><h3 align="center"><b>EXCELLENCE</b></h3><h3 align="left"><font color="#636363">Lorem Ipsum is simply dummy text of the printing and typesetting \r\nindustry. Lorem Ipsum has been the industry\'s standard dummy text ever \r\nsince the 1500s,</font><br></h3>', '1493648867_e0394a3b-0b10-4c7e-88b3-75a1a2ec2520.jpg', 1, '2017-04-27 10:44:49'),
(6, 'terms_condition', '<p>I agree with the Privacy Policy &amp; Terms of Use and I also understand that by subscribing, Nice n’ Easy may access basic information that is filled out on Facebook<br></p>', '<p>Συμφωνώ με την Πολιτική Απορρήτου &amp; τους Όρους Χρήσης και παράλληλα, κατανοώ πως κατά την εγγραφή μου, το Nice n’ Easy μπορεί να έχει πρόσβαση σε βασικές πληροφορίες που έχω συμπληρώσει στο Facebook<br></p>', '', 1, '2017-06-09 09:04:08');
