(19, 1, 2, 'Are you a fussy eater? Have your meals personalised to your DNA', 'Are you a fussy eater? Have your meals personalised to your DNA', 'Previously, this had only been available for dogs, or celebrities such as Formula One drivers, said the founder of Vita Mojo, Nick Popovici. "We decided it was time for humans to have access to that luxury. The food is \'ultra-personalised\', not just by taste, but by genes."', 'Previously, this had only been available for dogs, or celebrities such as Formula One drivers, said the founder of Vita Mojo, Nick Popovici. "We decided it was time for humans to have access to that luxury. The food is \'ultra-personalised\', not just by taste, but by genes."', 'indore', '', '', '', '1496041020_170411_VitaMojo_17459-large_trans_NvBQzQNjv4BqZgEkZX3M936N5BQK4Va8RWtT0gK_6EfZT336f62EI5U.jpg', '', '2017-05-29 06:57:00', 0),
(20, 1, 3, 'Flora Shedden: refreshing summer treats', 'Flora Shedden: refreshing summer treats', 'Renovating the ARAN bakery has been an educational process. I knew the workload would be intense, and that it would be financially stressful.', 'Renovating the ARAN bakery has been an educational process. I knew the workload would be intense, and that it would be financially stressful.', 'mumbai', '', '', '', '1496042152_mussels-steamed-curry-large.jpg', '', '2017-05-29 07:15:52', 0),
(21, 1, 1, 'Cooking is the ultimate form of therapy', 'Cooking is the ultimate form of therapy', 'The only things that were to remain unchanged were the exposed stone walls and the floor. Until, that is, a few weeks ago when the floor’s stability was questioned. Upon further investigation it transpired a new concrete floor was required (the original one consisted of a wooden frame sitting on damp soil with timber boards stuck directly on top. Very cold!).', 'The only things that were to remain unchanged were the exposed stone walls and the floor. Until, that is, a few weeks ago when the floor’s stability was questioned. Upon further investigation it transpired a new concrete floor was required (the original one consisted of a wooden frame sitting on damp soil with timber boards stuck directly on top. Very cold!).', 'New york', '', '', '', '', '', '2017-05-29 07:19:52', 0),
(22, 1, 2, 'Sleeping For Less Than 6 Hours May Double Risk Of Death From Stroke', 'Sleeping For Less Than 6 Hours May Double Risk Of Death From Stroke', 'The study, published in the Journal of the American Heart Association, reveals that, failing to sleep for less than six hours may nearly double the risk of death in people with metabolic', 'The study, published in the Journal of the American Heart Association, reveals that, failing to sleep for less than six hours may nearly double the risk of death in people with metabolic', 'mumbai', '', '', '', '', '', '2017-05-29 07:34:10', 0),
(23, 1, 2, '7 Delicious Bedtime Snacks You Can Have Even if You\'re Trying to Lose Weight', '7 Delicious Bedtime Snacks You Can Have Even if You\'re Trying to Lose Weight', 'If you feel like munching on something, here are seven delicious snacks you can have at night. They will satisfy your cravings and also help you reach your weight loss goals.', 'If you feel like munching on something, here are seven delicious snacks you can have at night. They will satisfy your cravings and also help you reach your weight loss goals.', 'indore', '', '', '', '', '', '2017-05-29 07:38:16', 0),
