(27, 1, 2, 'Disney\'s Guardians Of The Galaxy Menu Is Epic', 'Disney\'s Guardians Of The Galaxy Menu Is Epic', 'As if you needed another reason to visit Disney this summer, we\'ve just got the details on the new Guardians of The Galaxy menu, and it sounds seriously incredible. Disney\'s got a lot of amazing eats, but these new, limited time offerings are definitely going to get all the \'grams this summer.', 'As if you needed another reason to visit Disney this summer, we\'ve just got the details on the new Guardians of The Galaxy menu, and it sounds seriously incredible. Disney\'s got a lot of amazing eats, but these new, limited time offerings are definitely going to get all the \'grams this summer.', 'indore', '', '', '', '', '', '2017-05-29 08:25:26', 0),
(28, 1, 1, 'Stephen Harris: simplifying the cake-making process', 'Stephen Harris: simplifying the cake-making process', 'The case was put that Jaffa Cakes are a similar size to a biscuit and eaten with the hand in the same way, so should be taxed accordingly. The clinching argument was that Jaffa Cakes go hard as they become stale, while biscuits go soft. But I digress.', 'The case was put that Jaffa Cakes are a similar size to a biscuit and eaten with the hand in the same way, so should be taxed accordingly. The clinching argument was that Jaffa Cakes go hard as they become stale, while biscuits go soft. But I digress.', 'indore', '', '', '', '', '', '2017-05-29 08:32:24', 0),
(29, 1, 3, 'Skosh, York, restaurant review: Enjoy the little things in life', 'Skosh, York, restaurant review: Enjoy the little things in life', 'So when I learnt of a hotly praised new restaurant in York bearing the same name, I assumed it was going to be some sort of theme place where the waiters all had bandy legs and wore anoraks indoors, and addressed you mockingly as Our Kid, to a soundtrack of spiralling Sixties-influenced grooves. But no.', 'So when I learnt of a hotly praised new restaurant in York bearing the same name, I assumed it was going to be some sort of theme place where the waiters all had bandy legs and wore anoraks indoors, and addressed you mockingly as Our Kid, to a soundtrack of spiralling Sixties-influenced grooves. But no.', 'indore', '', '', '', '', '', '2017-05-29 08:35:14', 0),
