(32, 1, 3, 'MUSHROOM FESTIVAL IN GREVENA', 'ΦΕΣΤΙΒΑΛ ΜΟΥΣΕΙΟΥ ΣΤΗΝ ΓΡΕΒΕΝΑ', 'For decades, a unique form of ‘hunt’ has been taking place on the slopes surrounding the Valia Kalda valley in the prefecture of Grevena, northwestern Greece. The so-called “mushroom hunt”, or wild mushroom picking. It is a trade that has been passed down from generation to generation and takes quite a bit of skill. This region in northern Greece is known for having more than 2,600 species of wild mushrooms, many of which are edible. It is also known for the plethora of dishes it produces with mushroom as its base, so obviously it is the place to go when you want to enjoy a mushroom festival.\r\nThe 9th Annual Panhellenic Mushroom Festival in Grevena is scheduled to take place in the village of Ziaka on November 4-5, with professional chefs from all over the globe.If you want to sample mushroom liqueur, mushroom loukoumi and mushroom sweets on a spoon (glyko tou koutaliou) then I suggest you visit this festival.\r\nPeople in this area of Greece take mushroom cultivation and mushroom picking very seriously and have therefore set up a Mushroom Society, which informs visitors about the area’s mushrooms and also on how to cook them. \r\nWhether a hobby or profession, mushroom picking is part of the daily life of Grevena. Wild mushrooms, especially, are an important source of revenue for Grevena, with many locals involved in the trade, while there is even a specialised local taverna that features dishes with more than 100 wild species and it is opened year round.', 'Για δεκαετίες, λαμβάνει χώρα μια μοναδική μορφή «κυνηγιού» ​​στις πλαγιές που περιβάλλουν την κοιλάδα Βάλια Κάλντα στο νομό Γρεβενών της βορειοδυτικής Ελλάδας. Το λεγόμενο "κυνήγι μανιταριών", ή μάζεμα άγριων μανιταριών. Είναι ένα εμπόριο που έχει μεταβιβαστεί από γενιά σε γενιά και παίρνει αρκετή δεξιότητα. Αυτή η περιοχή στη βόρεια Ελλάδα είναι γνωστή ότι έχει περισσότερα από 2.600 είδη άγριων μανιταριών, πολλά από τα οποία είναι βρώσιμα. Είναι επίσης γνωστή για την πληθώρα των πιάτων που παράγει με το μανιτάρι ως βάση της, έτσι προφανώς είναι το μέρος για να πάτε όταν θέλετε να απολαύσετε ένα φεστιβάλ μανιταριών.\r\nΤο 9ο Ετήσιο Πανελλήνιο Φεστιβάλ Μανιταριών στα Γρεβενά έχει προγραμματιστεί να πραγματοποιηθεί στο χωριό Ζιάκα στις 4-5 Νοεμβρίου, με επαγγελματίες σεφ από όλο τον κόσμο. Εάν θέλετε να δοκιμάσετε λικέρ μανιταριών, μανιτάρια λουκουμιών και μανιταριών σε κουτάλι ( Γλύκο του κουταλίου) τότε σας προτείνω να επισκεφθείτε αυτό το φεστιβάλ.\r\nΟι άνθρωποι σε αυτή την περιοχή της Ελλάδας παίρνουν πολύ σοβαρά την καλλιέργεια μανιταριών και τη μανιταμπόλα και, ως εκ τούτου, έχουν συστήσει μια Μανιταρωτή Εταιρεία, η οποία ενημερώνει τους επισκέπτες για τα μανιτάρια της περιοχής καθώς και για το πώς να τα μαγειρεύουν.\r\nΕίτε ένα χόμπι είτε ένα επάγγελμα, η μανιταρία είναι μέρος της καθημερινής ζωής των Γρεβενών. Ειδικά τα άγρια ​​μανιτάρια αποτελούν σημαντική πηγή εσόδων για τα Γρεβενά, με πολλούς ντόπιους που συμμετέχουν στο εμπόριο, ενώ υπάρχει και μια εξειδικευμένη τοπική ταβέρνα με πιάτα με περισσότερα από 100 άγρια ​​είδη και είναι ανοιχτό όλο το χρόνο.', 'Grevena, Greece', '', '', '', '1496395303_s-d59c35dc327c4ded0a8123572da84bf6f9408d62.jpg', '', '2017-06-02 09:21:43', 0),
(33, 1, 3, 'Sardine Festival in Skala Kalloni', 'Φεστιβάλ σαρδέλας στη Σκάλα Καλλονής', 'Kalloni (Greek: Καλλονή) is the name of a town, and since the 2011 local government reform the name of a municipal unit of the municipality Lesbos, in the west-central part of the island of Lesbos, Greece. Prior to 2011 the current municipal unit was a municipality.[2] The name also existed in ancient times, though the conventional transcription of the classical name in English is "Callone".\r\n\r\nIt has a land area of 241.946 km².[3] At the 2011 census it had a population of 8,504 inhabitants. The municipal seat was the town of Kalloní (pop. 1,978). The unit\'s largest other towns are Agra (955), Parákoila (818), Dáfia (992), Fília (653), Skalochóri (534), Anemotia (449), and Kerámi (584). Kalloni was known as Kalonya during Ottoman rule, when it was a nahiya (township) center in the Molova kaza of the Midilli sanjak. Lesbos became part of the Kingdom of Greece in 1912.[4]', 'Η Καλλονή είναι το όνομα μιας πόλης και από τη δημοτική μεταρρύθμιση του 2011 το όνομα δημοτικής μονάδας του Δήμου Λέσβου στο δυτικό-κεντρικό τμήμα της Λέσβου. Πριν από το 2011 η σημερινή δημοτική μονάδα ήταν δήμος [2]. Το όνομα υπήρχε επίσης στην αρχαιότητα, αν και η συμβατική μεταγραφή του κλασικού ονόματος στα αγγλικά είναι "Callone".\r\n\r\nΈχει έκταση 241.946 τετραγωνικών χιλιομέτρων. [3] Κατά την απογραφή του 2011 είχε πληθυσμό 8.504 κατοίκων. Η δημοτική έδρα ήταν η πόλη της Καλλονής (1.978). Οι μεγαλύτερες άλλες πόλεις της μονάδας είναι η Agra (955), η Parákoila (818), η Dáfia (992), η Fília (653), η Skalochóri (534), η Anemotia (449) και η Kerámi (584). Η Καλλονή ήταν γνωστή ως Καλονία κατά τη διάρκεια της οθωμανικής κυριαρχίας, όταν ήταν κέντρο νάϊγια (δήμος) στο Μολόβα καζά του Μαντιλλί Σαντζάκ. Η Λέσβος έγινε μέρος του Βασιλείου της Ελλάδος το 1912. [4]', 'lesvos island greece', '', '', '', '1496395605_mjtvos1001_10_50.jpg', '', '2017-06-02 09:26:45', 0),
(34, 1, 2, 'Souvlaki: The Origins of Greek Fast Food', 'Σουβλάκι: Η προέλευση του ελληνικού φαγητού', 'Greece is well known for its delicious cuisine and healthy Mediterranean diet, but what about its fast food? Everyone who has visited the country has tasted at least once the famous “souvlaki” or “souvlaki with pita” or “pita gyros,” three dishes combining meat in a very tasteful dish that has become a trademark of the modern Greek culture over the years along with other products such as the frappe, ouzo, retsina and feta cheese.\r\n\r\nWhether to take away, eat it out on the curb or just sit in the shop and enjoy it at your leisure, souvlaki and pita gyros have become the most popular, convenient, and cost-effective food option someone can come across in Greece despite, or even rather because of the times of the economic crisis.\r\n\r\n- See more at: http://greece.greekreporter.com/2012/07/31/souvlaki-the-origins-of-greek-fast-food/#sthash.s6YMaPiR.dpuf', 'Η Ελλάδα είναι γνωστή για την υπέροχη κουζίνα και την υγιεινή μεσογειακή διατροφή, αλλά τι γίνεται με το γρήγορο φαγητό; Ο καθένας που έχει επισκεφτεί τη χώρα έχει δοκιμάσει τουλάχιστον μία φορά το διάσημο «σουβλάκι» ή «σουβλάκι με πίτα» ή «πίττα γύρου», τρία πιάτα που συνδυάζουν κρέας με ένα πολύ καλαίσθητο πιάτο που έχει γίνει εμπορικό σήμα του σύγχρονου ελληνικού πολιτισμού τα τελευταία χρόνια Μαζί με άλλα προϊόντα όπως φραπέ, ούζο, ρετσίνα και φέτα.\r\n\r\nΕίτε πρόκειται να αφαιρέσετε, να το φάτε στο περίπτερο ή απλά να καθίσετε στο κατάστημα και να το απολαύσετε στον ελεύθερο χρόνο σας, το souvlaki και το pita gyros έχουν γίνει η πιο δημοφιλής, βολική και οικονομικά αποδοτική επιλογή τροφίμων που μπορεί να συναντήσει κανείς στην Ελλάδα, Ή μάλλον λόγω της εποχής της οικονομικής κρίσης.\r\n\r\n- Δείτε περισσότερα στο: http://greece.greekreporter.com/2012/07/31/souvlaki-the-origins-of-greek-fast-food/#sthash.s6YMaPiR.dpuf', 'Greece', '', '', '', '1496403004_souvlaki.jpeg', '', '2017-06-02 11:30:04', 0),
(35, 1, 2, 'Foodies Alert: Greek Islands and the Foods They Are Famous For.', 'Ειδοποίηση τροφίμων: Τα ελληνικά νησιά και τα τρόφιμα είναι διάσημα', 'People come to Greece for holidays and experience many of the typical Greek dishes that the country is famous for. However, instead of sitting down for dinner at a taverna and sampling Greek cuisine, why not make a trip to Greece all about discovering the terrain from which your favorite Greek food originates? Let’s look at Greece’s foodie hotspots with the top islands known for sumptuous Greek cuisine!', 'Οι άνθρωποι έρχονται στην Ελλάδα για διακοπές και δοκιμάζουν πολλά από τα τυπικά ελληνικά πιάτα για τα οποία είναι διάσημη η χώρα. Ωστόσο, αντί να καθίσετε για δείπνο σε μια ταβέρνα και να δοκιμάσετε ελληνική κουζίνα, γιατί να μην κάνετε ένα ταξίδι στην Ελλάδα για να ανακαλύψετε το έδαφος από το οποίο προέρχεται το αγαπημένο σας ελληνικό φαγητό; Ας δούμε τα hotspots της Ελλάδας με τα κορυφαία νησιά που είναι γνωστά για πλούσια ελληνική κουζίνα!', 'Greece', '', '', '', '1496404252_Greek_food_Greek_islands.jpg', '', '2017-06-02 11:50:52', 0),
(36, 1, 2, 'Deprived Greeks Push and Shove for a Bag of Free Food', 'Οι άποροι Έλληνες πιέζουν και σέβονται για μια τσάντα δωρεάν φαγητού', 'Hundreds of deprived Thessaloniki residents who qualify for free food pushed and shoved each other during a food distribution at the Thessaloniki Exposition Center.\r\n\r\nUnder the Fund for European Aid for the Most Deprived (FEAD) program, carried out by the Municipality of Thessaloniki, hundreds of people gathered at Pavillion 16 of the Thessalonikι Exposition Center on Wednesday in order to receive a bag of food each. The organizers had put bars in the area to keep the lines of people orderly.\r\n\r\nSoon, however, the heat and the time of waiting made many of the people standing in line to push away the bars and start pushing and shoving each other in order to get near the stalls with the food faster. The municipal workers had to stop distribution several times in order to restore the order.', 'Εκατοντάδες στερημένοι κάτοικοι της Θεσσαλονίκης που πληρούν τις προϋποθέσεις για δωρεάν σίτιση ωθούνται και συστέλλονται μεταξύ τους κατά τη διάρκεια της διανομής τροφίμων στο Κέντρο Εκθέσεων Θεσσαλονίκης.\r\n\r\nΣτο πλαίσιο του προγράμματος του Ταμείου για την Ευρωπαϊκή Ενίσχυση για τους πλέον άπορους (FEAD), που πραγματοποιήθηκε από το Δήμο Θεσσαλονίκης, εκατοντάδες άνθρωποι συγκεντρώθηκαν στην Pavillion 16 του Κέντρου Εκθέσεων Θεσσαλονίκης την Τετάρτη για να λάβουν μία τσάντα φαγητού η καθεμία. Οι διοργανωτές είχαν βάλει μπαρ στην περιοχή για να διατηρήσουν τις γραμμές των ανθρώπων κανονικά.\r\n\r\nΣύντομα, όμως, η θερμότητα και ο χρόνος της αναμονής έκαναν πολλούς από τους ανθρώπους να στέκονται στη γραμμή για να σπρώξουν τα μπαρ και να ξεκινήσουν να σπρώχνουν και να σπρώχνουν ο ένας τον άλλον, ώστε να πλησιάσουν τους πάγκους με το φαγητό πιο γρήγορα. Οι δημοτικοί εργάτες έπρεπε να σταματήσουν τη διανομή αρκετές φορές για να αποκαταστήσουν την παραγγελία.', 'Greece', '', '', '', '', '', '2017-06-02 12:02:53', 0);
